import React from "react";
import "./style.css";

function HeaderMain() {
  return (
    <React.Fragment>
      <header>
        <img src="/react-portfolio/assets/code-img.jpg" alt="header image of code" />
      </header>
    </React.Fragment>
  );
}

export default HeaderMain;
